<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Property Knowing Script</title>
  </head>
  <body>
    <script>
      let table = document.createElement("table");
      for (let Property in table) {
        document.write(Property + "<br>");
      }
    </script>
  </body>
</html>
